#
# TABLE STRUCTURE FOR: Citation
#

DROP TABLE IF EXISTS `Citation`;

CREATE TABLE `Citation` (
  `citation_id` int(11) NOT NULL AUTO_INCREMENT,
  `citation_number` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL,
  `date_recieved` datetime NOT NULL,
  `citation_type_id` int(11) DEFAULT NULL,
  `officer_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`citation_id`),
  UNIQUE KEY `citation_number` (`citation_number`),
  KEY `officer_id` (`officer_id`),
  KEY `citation_type_id` (`citation_type_id`),
  CONSTRAINT `Citation_ibfk_1` FOREIGN KEY (`officer_id`) REFERENCES `Person` (`person_id`),
  CONSTRAINT `Citation_ibfk_2` FOREIGN KEY (`citation_type_id`) REFERENCES `Citation_Type` (`citation_type_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



